const PrimaComponent = () => 
{
    return(
        <>
            <h1>Foto</h1>
            <div className="row" style={{marginTop:"5%", padding:"5px"}}>
                <div className="col">
                    <ImageComponent numero="1" foto="https://storage.edidomus.it/ListinoAuto/FOTO_A_16_9_640/00052908.JPG" modello="Toyota yaris" dimensione="col-md-4"/>
                </div>
                <div className="col">
                    <ImageComponent numero="2" foto="https://rentedrive.it/wp-content/uploads/2020/03/Toyota-Yaris-2020-Esterno-anteriore.jpg" modello="Toyota yaris" dimensione="col-md-4"/>
                </div>
                <div className="col">
                    <ImageComponent numero="3" foto="https://rentedrive.it/wp-content/uploads/2020/03/Toyota-Yaris-2020-Esterno-posteriore.jpg" modello="Toyota yaris" dimensione="col-md-4"/>
                </div>
            </div>
        </>
    );
}

const ImageComponent = (props) =>
{
    let {numero,foto,modello,dimensione} = props;
    const titolo = <>
                        <h1>Foto numero: {numero}</h1>
                        <h2>Modello: {modello}</h2>
                    </>;
    return(
        <div>
            {titolo}
            <div style={{padding:"20px",border:"1px solid black", display:"inline-block"}}>
                <img src={foto} style={{maxWidth:"100%"}}></img>
            </div>
        </div>
    );
}

export default PrimaComponent;
